import React, { useState, useEffect } from 'react';
import axios from 'axios';
im

const Shopping = () => {
  const [products, setProducts] = useState([]);
  const [error, setError] = useState('');
  const [category, setCategory] = useState('');

  useEffect(() => {
    const fetchProducts = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/api/products/${category}`);
        setProducts(response.data);
      } catch (err) {
        setError('Failed to fetch products');
      }
    };

    fetchProducts();
  }, [category]);

  const handleCategoryChange = (category) => {
    setCategory(category);
  };

  return (
    <div className="shopping-container">
      <nav className="shopping-navbar">
        <ul>
          <li>
            <a href="#fruits" onClick={() => handleCategoryChange('fruits')}>
              Fruits
            </a>
          </li>
          <li>
            <a href="#vegetables" onClick={() => handleCategoryChange('vegetables')}>
              Vegetables
            </a>
          </li>
          <li>
            <a href="#grains-and-cereals" onClick={() => handleCategoryChange('grains-and-cereals')}>
              Grains and Cereals
            </a>
          </li>
          <li>
            <a href="#pulses-and-legumes" onClick={() => handleCategoryChange('pulses-and-legumes')}>
              Pulses and Legumes
            </a>
          </li>
          <li>
            <a href="#spices-and-herbs" onClick={() => handleCategoryChange('spices-and-herbs')}>
              Spices and Herbs
            </a>
          </li>
          <li>
            <a href="#nuts-and-seeds" onClick={() => handleCategoryChange('nuts-and-seeds')}>
              Nuts and Seeds
            </a>
          </li>
        </ul>
      </nav>
      <div className="product-sections">
        <div id="fruits" className="product-section">
          <h2>Fruits</h2>
          <ul>
            {products.filter((product) => product.category === 'fruits').map((product) => (
              <li key={product._id}>
                {product.name} - {product.quantity} kg - ₹{product.price} per kg
              </li>
            ))}
          </ul>
        </div>
        <div id="vegetables" className="product-section">
          <h2>Vegetables</h2>
          <ul>
            {products.filter((product) => product.category === 'vegetables').map((product) => (
              <li key={product._id}>
                {product.name} - {product.quantity} kg - ₹{product.price} per kg
              </li>
            ))}
          </ul>
        </div>
        <div id="grains-and-cereals" className="product-section">
          <h2>Grains and Cereals</h2>
          <ul>
            {products.filter((product) => product.category === 'grains-and-cereals').map((product) => (
              <li key={product._id}>
                {product.name} - {product.quantity} kg - ₹{product.price} per kg
              </li>
            ))}
          </ul>
        </div>
        <div id="pulses-and-legumes" className="product-section">
          <h2>Pulses and Legumes</h2>
          <ul>
            {products.filter((product) => product.category === 'pulses-and-legumes').map((product) => (
              <li key={product._id}>
                {product.name} - {product.quantity} kg - ₹{product.price} per kg
              </li>
            ))}
          </ul>
        </div>
        <div id="spices-and-herbs" className="product-section">
          <h2>Spices and Herbs</h2>
          <ul>
            {products.filter((product) => product.category === 'spices-and-herbs').map((product) => (
              <li key={product._id}>
                {product.name} - {product.quantity} kg - ₹{product.price} per kg
              </li>
            ))}
          </ul>
        </div>
        <div id="nuts-and-seeds" className="product-section">
          <h2>Nuts and Seeds</h2>
          <ul>
            {products.filter((product) => product.category === 'nuts-and-seeds').map((product) => (
              <li key={product._id}>
                {product.name} - {product.quantity} kg - ₹{product.price} per kg
              </li>
            ))}
          </ul>
        </div>
      </div>
      {error && <div className="error-message">{error}</div>}
    </div>
  );
};

export default Shopping;
